    \node at (1, 1, 0) [above right] {C};
    \node at (0, 1, 0) [above left] {D};
    \node at (0, 0, 1) [above left] {E};
    \node at (1, 0, 1) [above right] {F};
    \node at (1, 1, 1) [above right] {G};
